import React from "react";
import { Link } from "react-router-dom";

import SingleDefaultLayout from "../common/singleDefaultLayout";

const SingleRental = ({ deleteRental, name, phone, isGold, _id }) => {
  return (
    <SingleDefaultLayout>
      <div>
        <Link to={`/rentals/${_id}`}>{name}</Link>
        <p>{phone}</p>
        <p>Is Gold: {isGold ? "yes" : "no"}</p>

        <button
          className="btn btn-danger"
          onClick={() => {
            deleteRental(_id);
          }}
        >
          Delete Customer
        </button>
      </div>
    </SingleDefaultLayout>
  );
};

export default SingleRental;
